import React from 'react'
import logo from '../logo.png'
// import style from '../style.css'



const Navbar = () => {
  return (
    <header>
        <img src={logo} alt="minerva" />
        <nav>
            <a href=''>Home</a>
            <a href=''>Testimoni</a>
            <a href=''>Kontak</a>
            <a href=''>Home</a>
        </nav>
    </header>
  );
}

export default Navbar
